  win: true
}

const game2 = {
  win: false
}

const gameResults = [
  game1
  , game2
];

const App = () => {

  const [results, setResults] = useState(gameResults);


  return (
    <div className="App">
      <Routes>

        <Route path="play">
          <Play/>
        </Route>

